! Here are several lines from the poem:

1. Weary with toil, I haste me to my bed,
2. For where is she so fair whose unear'd womb
3. Delights to peep, to gaze therein on thee;
4. And trouble deal heaven with my bootless cries
5. With what I most enjoy contented least;
6. For wherefore see these days in darkly waste,
7. Where I may not remove nor be removed.
8. To give away yourself keeps yourself still,
9. As I, not for myself, but for thee will;
10. Or some fierce thing replete with too much rage,
11. Yet eyes this cunning want to grace their art;
12. Serving with looks his sacred majesty;
13. Then being ask'd where all thy beauty lies,
14. Though yet, heaven knows, it is but as a tomb
15. Which hides your life and shows not half your parts.
16. The world will be thy widow and still weep
17. Against this coming end you should prepare,
18. Or else of thee this I prognosticate:
19. Thy beauty's form in table of my heart;
